import React from "react";
import { useLocation, useNavigate } from "react-router-dom";

const OutputDisplay = () => {
  const location = useLocation();
  const navigate = useNavigate();

  // Get result from navigation state
  const result = location.state?.result || "No result available";

  const handleStoreOutput = () => {
    console.log("Storing output:", result);
    // Implement storage logic (e.g., API call or localStorage)
  };

  return (
    <div style={{ textAlign: "center", marginTop: "50px" }}>
      <h2>Output</h2>
      <p><strong>Prediction:</strong> {result}</p>

      <button onClick={handleStoreOutput} style={{ marginRight: "10px" }}>
        Store Output
      </button>
      <button onClick={() => navigate("/")}>Go Back</button>
    </div>
  );
};

export default OutputDisplay;
